import './App.css';
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import Join from "./component/Join/Join";
import Chat from "./component/Chat/Chat"




function App() {




  return (


    <Router>
      <Routes>
        <Route exact path="/" component={Join} />
        <Route path="/chat" component={Chat} />
      </Routes>

    </Router>

  );
}

export default App;
